import { Navigate, Route, Routes } from "react-router-dom";
import { Admin } from "./components/Admin";
import { Contact } from "./pages/Contact";
import { Footer } from "./components/Footer";
import { Header } from "./components/Header";
import { Home } from "./pages/Home";
import { ProductDetails } from "./pages/ProductDetails";
import { ProductList } from "./pages/ProductList";
import { Contactau } from "./components/contacts/Contactau";
import { Contactuk } from "./components/contacts/Contactuk";
import { Contactus } from "./components/contacts/Contactus";

import './App.css';

function App() {
  const loggedin = true; // Simulating a logged-in user for demonstration

  return (
      <div className="App">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/products" element={<ProductList />} />
            <Route path="/products/:id" element={<ProductDetails />} />
            <Route path="/contact" element={<Contact />}>
              <Route path="au" element={<Contactau />} />
              <Route path="us" element={<Contactus />} />
              <Route path="uk" element={<Contactuk />} />
              <Route path="*" />
            </Route>
            <Route path="/admin" element={loggedin ? <Admin /> : <Navigate to="/" />} />
          </Routes>
        </main>
        <Footer />
      </div>
  );
}

export default App;
